    /**
    * Creates an incident to test against.
    */
    @BeforeMethod
    public void createDoubleOccurrenceOfCleansedVoteLineIncident() {
        incident = new VcsEncryptedVoteRetainedMoreThanOnceIncident(new VcsEncryptedVote(
                    VCS_ENCRYPTED_VOTE_LINE), 2);
    }

    /**
     * Verifies that an incident is equal to itself.
     */
    @Test
    public void mustBeEqualToItself() {
        assertEquals(incident, incident);
    }

    /**
     * Verifies that an incident has a consistent hashCode.
     */
    @Test
    public void mustHaveSameHashCodeAsItself() {
        assertEquals(incident.hashCode(), incident.hashCode());
    }

    /**
     * Verifies that an incident is not equal to null.
     */
    @Test
    public void mustNotBeEqualToNull() {
        Object nullObject = null;
        assertFalse(incident.equals(nullObject));
    }

    /**
     * Verifies that an incident is not equal to an object of another class. This is used as the test case.
     */
    @Test
    public void mustNotBeEqualToAnObjectOfAnotherClass() {
        assertFalse(incident.equals(this));
    }

    /**
     * Verifies that the incident is equal to another incident with the same VCS encrypted vote and number of matches.
     */
    @Test
    public void mustBeEqualToAnotherVcsEncryptedVoteRetainedMoreThanOnceIncidentWithTheSameVcsEncryptedVoteAndNoOfMatches() {
        assertEquals(incident,
            new VcsEncryptedVoteRetainedMoreThanOnceIncident(
                new VcsEncryptedVote(VCS_ENCRYPTED_VOTE_LINE), 2));
    }

    /**
     * Verifies that the incident has the same hashCode as another incident with the same VCS encrypted vote and number of matches.
     */
    @Test
    public void mustHaveSameHashCodeAsAnotherVcsEncryptedVoteRetainedMoreThanOnceIncidentWithTheSameVcsEncryptedVoteAndNoOfMatches() {
        assertEquals(incident.hashCode(),
            new VcsEncryptedVoteRetainedMoreThanOnceIncident(
                new VcsEncryptedVote(VCS_ENCRYPTED_VOTE_LINE), 2).hashCode());
    }

    /**
     * Verifies that the incident is not equal to another incident with another VCS encrypted vote.
     */
    @Test
    public void mustNotBeEqualToAnotherVcsEncryptedVoteRetainedMoreThanOnceIncidentWithAnotherVcsEncryptedVote() {
        assertFalse(incident.equals(
                new VcsEncryptedVoteRetainedMoreThanOnceIncident(
                    new VcsEncryptedVote(OTHER_VCS_ENCRYPTED_VOTE_LINE), 2)));
    }

    /**
     * Verifies that the incident is not equal to another incident with another number of matches.
     */
    @Test
    public void mustNotBeEqualToAnotherVcsEncryptedVoteRetainedMoreThanOnceIncidentWithAnotherNoOfMatches() {
        assertFalse(incident.equals(
                new VcsEncryptedVoteRetainedMoreThanOnceIncident(
                    new VcsEncryptedVote(VCS_ENCRYPTED_VOTE_LINE), THREE)));
    }

    /**
     * Verifies that toString produced a comma-separated line with the correct
     * values.
     */
    @Test
    public void toStringMustBeCommaSeparatedline() {
        assertEquals(incident.toString(),
            "VcsEncryptedVoteRetainedMoreThanOnceIncident," + UUID + ",2");
    }
